import React, { Component } from 'react';


class Mole extends Component {
  showItem = (i) =>{
    alert(i);
  }

  render() {
    return (
      <div className="container-item">
        <img src={'img/WAM_Hole.png'} alt="" onClick={this.showItem(this.props.index)}/>
      </div>
    );
  }
}

export default Mole;
